%pgx

// Mule Community

sg = g.filter(new EdgeFilter("edge.label()='transfer'"))

result = analyst.communitiesLabelPropagation(sg, 100)
result.eachWithIndex { it, index -> println "Partition " + index + " has " + it.size() + " vertices" }

cs = g.createChangeSet()
rs = g.queryPgql("SELECT DISTINCT a MATCH (a)-[:transfer]-()")
for (r in rs) {
  v = r.getVertex(1)
  i = result.getPartitionIndexOfVertex(v)
  cs.updateVertex(v.getId()).setProperty("community", i)
}
g = cs.build()
